import React, { useEffect, useState} from "react";


function OrganizerDrafts(){

    const [drafts, setDrafts] = useState([])

    useEffect(() => {
        fetch('/drafts')
          .then((res) => res.json())
          .then((data) => setDrafts(data))
      }, [])

      console.log(drafts);
    return(
        <>
        <OrganizerDrafts />

        </>
    )
}
export default OrganizerDrafts;
